import React from 'react';
import './CSS/prompt.css'

function TopButton() {
    return (
        <div className='topButton' onClick={() => { window.scrollTo(0, 0) }}>
        </div>);
}

function Jump(props) {
    let fun = props.change;
    var name = ['基本信息','学术能力','社交能力','普通能力'];
    for(let i in name)name[i] = <div className='jumpItems' onClick={(e) => { fun(i) }}>name[i]</div>
    return (<div className='jump'>
        <div className='jumpItems' onClick={(e) => { fun(0) }}></div>
        <div className='jumpItems' onClick={(e) => { fun(1) }}>基本信息</div>
        <div className='jumpItems' onClick={(e) => { fun(2) }}>基本信息</div>
        <div className='jumpItems' onClick={(e) => { fun(3) }}>基本信息</div>
        <div className='jumpItems' onClick={(e) => { fun(4) }}>基本信息</div>
    </div>);
}

class prompt extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
    render() {
        return (
            <div></div>
        );
    }
}

export {
    prompt,
    TopButton,
    Jump
};
